--[[
   GLOBAL VARIABLES (modifiable via GUI)
   _G.ScriptEnabled      : Master toggle for the script
   _G.FollowSpeed        : How smoothly the camera follows
   _G.AutoTriggerEnabled : Whether the auto-trigger is active
   _G.StillnessThreshold : Max movement allowed before resetting auto-trigger
   _G.TriggerDelay       : How long the target must be still before triggering
   _G.MaxDistance        : Maximum distance a target can be from the player to be considered
   _G.TargetPartName     : The part name to aim for (default: "HumanoidRootPart")
   _G.TargetAnyPart      : If true, target any available BasePart instead of the set one
   _G.TriggerKey         : Key to hold for activation (default: RightShift)
   _G.TriggerType        : "hold" or "toggle" - determines activation mode
   _G.TeamCheckEnabled   : Whether to only target players on the enemy team (ON by default)
   _G.SilentAimEnabled   : Toggle for silent aim
   _G.SilentAimLegitimacy : "legit", "semi-legit", or "unlegit" - controls silent aim behavior
   _G.TargetType         : "players", "npcs", or "all" - determines which targets to include (default: "players")
   _G.AimMethod          : "mouse" or "namecall" - choose which silent-aim method to use
   _G.SilentAimMethods   : A table of silent aim methods to use with the namecall method
   _G.Predictionenable  : sets prediction on or off
   _G.scaleddivisor : predition scale
   _G.ESPEnabled : esp state
]]

